import { Subscriber } from "rxjs";
export class DoneSubscriber extends Subscriber {
    constructor(onError, onComplete) {
        super(undefined, onError, onComplete);
        this.onError = onError;
    }
    unsubscribe() {
        try {
            super.unsubscribe();
        }
        catch (error) {
            this.onError(error);
        }
    }
}
